import Head from "next/head";
import Navbar from "../components/Navbar";

const Layout = (props) => (
  <div>
    {/* <Head> */}
    <title>Marwan's next project</title>
    <link
      rel="stylesheet"
      href="https://bootswatch.com/4/lux/bootstrap.min.css"
    />
    {/* </Head> */}
    <Navbar />
    <div>{props.children}</div>
  </div>
);

export default Layout;
